script: |
  super -f text -I q2526.spq | sort > q2526.out

inputs:
  - name: q2526.spq
    data: |
      SELECT DISTINCT + col1 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE NULL BETWEEN + col0 * + + 28 + ( col1 ) - - col1 * + col2 AND 14 + col0;
  - name: tab1

outputs:
  - name: q2526.out
    data: |
